import axios from 'axios';

export default function getBoardList(){
    axios(
        {
            url: '/board/getList',
            method: 'get',
            baseURL: 'http://localhost:8888',
            withCredentials: true,
        }
    ).then(function(resource) {
        alert(resource.data[0].title);
        console.log(resource);
    });
}
